const Template = (args) => <FeedBox {...args} />;

export const Default = Template.bind({});
Default.args = {
  feedId: 1,
  profileImg: 'https://placekitten.com/50/50', // Replace with the actual image URL
  userName: 'John Doe',
  isLiked: false,
  likeCount: 10,
  commentCount: 5,
